import React from 'react';
import PaymentForm from './PaymentForm'; // Adjust the path as needed

const CheckoutPage = () => {
    const checkoutId = 'your_checkout_id'; // Get this from your backend or state management
    const integrity = 'your_integrity_value'; // Same as above
    const shopperResultUrl = 'your_shopper_result_url'; // Same as above

    return (
        <div>
            <h1>Checkout</h1>
            <PaymentForm 
                checkoutId={checkoutId}
                integrity={integrity}
                shopperResultUrl={shopperResultUrl}
            />
        </div>
    );
};

export default CheckoutPage;
